import axios from "axios";

export default async function LoginAuth(data){
    const route = process.env.REACT_APP_API_ROUTE;
    console.log("Environment Variable REACT_APP_API_ROUTE:", route);  // Log to ensure it's being loaded
    console.log("Constructed URL:", `${route}/auth/login`);
    const response = await axios.post(`${route}/auth/login`, data);
    return response;
}
